import React from 'react';
import giticon from '../assets/images/giticon.svg';

function Puppet2ansible(){
    return(
        <div>
            <h3>Trabslator which translate Puppet module to Ansible role</h3>
            <p>Puppet2Ansible</p>
        </div>
    );
}

export default Puppet2ansible;
